      SELECT ALL + COUNT ( * ) FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col0 * - - col1 - col1 BETWEEN + 58 * - col1 + 43 AND + col2;
  - name: tab1

outputs:
  - name: q12791.out
    data: |
      2
